import React from "react";
import Member from "./member/member";
import Grid from "@material-ui/core/Grid";
import logo from "./poster.jpg";

const Team = (props) => {
  var member = [
    { src: {logo}, name: "Jone Dow", intro: "qwerew" },
    { src: {logo}, name: "anonymous", intro: "qwerew" },
  ];

  return (
    <Grid container spacing={3}>
      {member.map(element => (
      <Grid item xs={6} sm={4}>
        <Member src={element.src.logo} name={element.name} intro={element.intro}/>
      </Grid>
      ))}
    </Grid>
  );
};

export default Team;
